(0..posts.length-1).each do |i|

      begin
            # puts "fetching post ##{i.to_s} #{posts[i][0]}"
            subject = posts[i][1].split("/")[1]
            file_name = "medium_posts/#{subject}_#{posts[i][0].split("/")[4]}.txt"
            if File.exist?(file_name)
              # puts "downloaded..skipping"
              print "y"
            else
              print "."

                  raw_html = open(posts[i][0]).read
                  # puts raw_html
                  page = Nokogiri::HTML(raw_html)
                  title = page.css(".post-title").text()
                  content = page.css(".post-field.body p").text()
                  # handle strings directly
                  single_post = File.open(file_name, "w")
                  single_post.write(title+"\n")
                  single_post.write(content)
                  single_post.close unless single_post == nil
              #sleep 0.5
            end
      rescue
          puts "post number #{i.to_s} ( #{posts[i][0]} ) aborted"
          sleep 0.8
      end
end
